import React from "react";
import { useNavigate } from "react-router-dom";

export default function FormEmailAutentic(){
    const navigate = useNavigate();
    const handleSubmit = (event)=>{
        event.preventDefault();
        navigate("/success");
    }

    return(
        <div className="container">
            <form onSubmit={handleSubmit}>
                <p>Enviamos um código de confirmação para o seu email</p>
                <p className="warning">Para concluir a configuração da conta, insira o código que foi enviado para:</p>
                <div className="inputField">
                    <label htmlFor="email">Emailtestw@gmail.com</label>
                    <input type="email" name="email" placeholder="Digite seu email aqui..." required/>
                </div>
                <input type="submit" value="Continuar" className="submitBtn"/>

            </form>
        </div>
    )
}
